/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<div	class="${classMap(context.classes.root)}"	dir="${ifDefined(context.rtl)}">	${ context.tabsAtTheBottom ? block1(context) : undefined }<div class="${classMap(context.classes.header)}" id="${ifDefined(context._id)}-header"><ui5-icon @click="${context._onHeaderBackArrowClick}" class="${classMap(context.classes.headerBackArrow)}" name="slim-arrow-left" tabindex="-1" accessible-name="${ifDefined(context.previousIconACCName)}" show-tooltip></ui5-icon><!-- tab items --><div class="${classMap(context.classes.headerScrollContainer)}" id="${ifDefined(context._id)}-headerScrollContainer"><ul				role="tablist"				class="${classMap(context.classes.headerList)}"				@click="${context._onHeaderClick}"				@keydown="${context._onHeaderKeyDown}"				@keyup="${context._onHeaderKeyUp}"			>				${ repeat(context.items, (item, index) => item._id || index, (item, index) => block4(item, index, context)) }</ul></div><ui5-icon @click="${context._onHeaderForwardArrowClick}" class="${classMap(context.classes.headerForwardArrow)}" name="slim-arrow-right" tabindex="-1" accessible-name="${ifDefined(context.nextIconACCName)}" show-tooltip></ui5-icon><!-- overflow button -->		${ context.showOverflow ? block7(context) : undefined }</div>	${ !context.tabsAtTheBottom ? block8(context) : undefined }</div>`; };
const block1 = (context) => { return html`<div class="${classMap(context.classes.content)}">		${ repeat(context.items, (item, index) => item._id || index, (item, index) => block2(item, index, context)) }</div>`; };
const block2 = (item, index, context) => { return html`${ !item.isSeparator ? block3(item, index, context) : undefined }`; };
const block3 = (item, index, context) => { return html`<div class="ui5-tc__contentItem" id="ui5-tc-contentItem-${ifDefined(item._position)}" ?hidden="${item.effectiveHidden}" role="tabpanel" aria-labelledby="${ifDefined(item._id)}"><slot name="${ifDefined(item._individualSlot)}"></slot></div>			`; };
const block4 = (item, index, context) => { return html`${ !item.isSeparator ? block5(item, index, context) : undefined }${ item.isSeparator ? block6(item, index, context) : undefined }`; };
const block5 = (item, index, context) => { return html`${ifDefined(item.stripPresentation)}`; };
const block6 = (item, index, context) => { return html`<li id="${ifDefined(item._id)}" role="separator" class="${classMap(context.classes.separator)}"></li>					`; };
const block7 = (context) => { return html`<ui5-button				@click="${context._onOverflowButtonClick}"				class="${classMap(context.classes.overflowButton)}"				icon="${ifDefined(context.overflowMenuIcon)}"				type="Transparent"				title="${ifDefined(context.overflowMenuTitle)}"				design="Transparent"			></ui5-button>		`; };
const block8 = (context) => { return html`<div class="${classMap(context.classes.content)}">		${ repeat(context.items, (item, index) => item._id || index, (item, index) => block9(item, index, context)) }</div>`; };
const block9 = (item, index, context) => { return html`${ !item.isSeparator ? block10(item, index, context) : undefined }`; };
const block10 = (item, index, context) => { return html`<div class="ui5-tc__contentItem" id="ui5-tc-contentItem-${ifDefined(item._position)}" ?hidden="${item.effectiveHidden}" role="tabpanel" aria-labelledby="${ifDefined(item._id)}"><slot name="${ifDefined(item._individualSlot)}"></slot></div>			`; };

export default block0;
